import React from "react";
import {
  Nav,
  Navbar,
  NavDropdown,
  Form,
  FormControl,
  Button,
} from "react-bootstrap";

function Home() {
  return (
    <Navbar bg="light" expand="lg">
    <Navbar.Brand href="/">
      <img
        src="/logo.png"
        width="60"
        height="60'
        "
        className="d-inline-block align-top"
        alt="React Bootstrap logo"
      />
    </Navbar.Brand>
    </Navbar>

  );
}

export default Home;
